import Link from "next/link";

const Menu = () => (
  <div>
    <Link href="/">
      <a>Home</a>
    </Link>
    <Link href="/about">
      <a>About</a>
    </Link>
    <Link href="/design">
      <a>Design</a>
    </Link>
  </div>
);

export default Menu;
